import React from "react";
import "./Resume.css";
import he from "he";


interface ResumeProps {
  html: string;
}

export default function Resume(props: ResumeProps) {
  const decodedHtml = he.decode(props.html);

  return (
    <div id="resumeWindow" className="resumeWindow">
      <div id="resume">
      <header>
        <h1>JEFFREY VAN OOSTERWIJK</h1>
        <p id="contactInformation">
          jeffrey.oosterwijk@hotmail.com - +31 (0)6 40121748 - <a href="https://www.linkedin.com/in/jeffrey-van-oosterwijk-2b9154187/">linkedIn</a> - The
          Hague, The Netherlands
        </p>
        <h2>SKILLS</h2>
        <div className="skills">
          <ul>
            <li>Tech principles: Event-driven architecture, Object-oriented programming, microservices, SOLID</li>
            <li>Code: C#, .NET core, React, Javascript, TypeScript, GraphQL, Java, CSS, HTML, Unity, Python</li>
            <li>Tools: Docker,AWS, Kafka, CI & CD,Azure DevOps, Datadog, Splunk, GitLab, GitHub</li>
            <li>Databases: MySQL, PostgreSQL, DynamoDB, MSSQL, Oracle</li>
            <li>Methodology: Scrum, Agile, Kanban</li>
          </ul>
        </div>
        <h2>EXPERIENCE</h2>
        <div className="experience">
        <h3 className="left">Coolblue</h3>
        <h3 className="right">Sep 2021 - Present</h3>
        <p className="companySummary">E-commerce company, operating in the Netherlands, Germany, Belgium with annual revenues of 2.3 billion euros</p>
        <h4 className="left bold">Software Engineer</h4>
        <h4 className="right bold">Feb 2023 - Present</h4>

        </div>
      </header>
      </div>
    </div>
  );

// return (
